def strip_url(url, strip_credentials=True, strip_default_port=True, origin_only=False, strip_fragment=True):
    """Strip URL string from some of its components:

    - ``strip_credentials`` removes "user:password@"
    - ``strip_default_port`` removes ":80" (resp. ":443", ":21")
    from http:// (resp. https://, ftp://) URLs
    - ``origin_only`` replaces path component with "/", also dropping
    query and fragment components ; it also strips credentials
    - ``strip_fragment`` drops any #fragment component
    """
    if not url:
        return url

    url = to_unicode(url)
    parsed = urlparse(url)

    if strip_credentials:
        if parsed.username and parsed.password:
            parsed = parsed._replace(username='')
        if parsed.netloc and parsed.username:
            parsed = parsed._replace(netloc='')

    if strip_default_port:
        if parsed.scheme in ('http', 'https') and parsed.port == 80:
            parsed = parsed._replace(port='')
        elif parsed.scheme in ('ftp',) and parsed.port == 21:
            parsed = parsed._replace(port='')

    if origin_only:
        if parsed.scheme:
            parsed = parsed._replace(scheme='', netloc='')
        if parsed.path:
            parsed = parsed._replace(path='/')

    if strip_fragment:
        parsed = parsed._replace(fragment='')

    return urlunparse(parsed)
